import {BrowserRouter as Router, Route, Routes} from "react-router-dom";
import Header from "../components/header";
import Slideshow from "../components/slideshow";
import QuienesSomos from "./quienesSomos";
import ClubesBoard from "../components/ClubesBoard";
import Footer from "../components/Footer";
import React from "react";
import EventsMain from "./events/eventsMain";
const Home=()=>{
    return <div>
        <Slideshow/>
        <ClubesBoard/>
        <div className="mapa">

            <iframe className="iframe" width="225" height="450"
                    src="https://www.openstreetmap.org/export/embed.html?bbox=-78.49013686180116%2C-0.21133613349101213%2C-78.48818957805635%2C-0.2096919504628004&amp;layer=mapnik"></iframe>
            <iframe width="425" height="350" frameBorder="0" scrolling="no" marginHeight="0" marginWidth="0"
                    src="https://www.openstreetmap.org/export/embed.html?bbox=-78.49100321531297%2C-0.21112692260961427%2C-78.48811715841295%2C-0.20948273955936764&amp;layer=mapnik"
                    style="border: 1px solid black"></iframe>
            
        </div>
    </div>
}
export default Home
